import GameCard from './shared/GameCard'
import axios from 'axios'




class Home extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            games: []
        }
    }


    componentDidMount() {

        this.getGames();

    }



    getGames = async () => {
        data = await axios.get(`https://localhost:3000/games`)
        console.log(data)
        this.setState({
            games: data
        })
    }


    render() {
        {
            this.state.games.map(game => {
                return (

                    <div className='game-card' key={game.id}>
                        <GameCard title={game.title}/>

                    </div>
                )
            })
        }



    }
}


export default Home
